import React, {Component} from "react";
import {Messages} from "primereact/messages";
import {Card} from "primereact/card";
import {InputText} from "primereact/inputtext";
import {classNames} from "primereact/utils";
import {Button} from "primereact/button";

export class User extends Component {

    constructor(props) {
        super(props);
        this.state = {
            user:'',
            submitted:''
        }
    }


    render() {

        return (
            <div style={{width:'80%', margin:'0 auto', marginTop:'40px'}}>
                <Messages ref={el => (this.messages = el)} />
                <Card title="My Rent" footer={this.footerCard}>
                    <div className="col-12 md:col-4">
                        <div className="field">
                            <label htmlFor="name">Name: </label>
                            <InputText id="name" value={this.state.user} onChange={(e) => this.onInputChange(e, 'name')} required autoFocus className={classNames({ 'p-invalid': this.state.submitted && !this.state.user })} />
                            {this.state.submitted && !this.state.user && <small className="p-error">Name is required.</small>}
                        </div>
                    </div>
                </Card>
            </div>
        );
    }
}

export default User;
